import AOS from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";

function Image() {
  useEffect(() => {
    AOS.init();
  }, []);
  return (
    <div className="col-4 vh-100 d-flex flex-wrap justify-content-center m">
      <img src="./img/Profile_pic2.JPEG" id="mypic" alt="Will_pic" />
    </div>
  );
}

export default Image;
